import ReactTable from 'react-table';

import 'react-table/react-table.css';


const Table = ({ pageSize = 20, columns, data, ...rest }) => {

  return (
    <ReactTable
      data={data}
      columns={columns}
      pageSize={pageSize}
      showPagination
      onPageSizeChange={() => console.log("on change")}
      // showPageSizeOptions={false}
      {...rest}
    />
  )
};

export default Table;
